import { Row, Col } from 'antd';

const Home = () => {
    return (
        <div>
            <Row>
                <Col span={7}>
                    asdf
                </Col>
                <Col span={17}>
                    qwer
                </Col>
            </Row>
        </div>
    )
};

export default Home;
